import React from 'react'
import axios from "axios";
import { useEffect, useState } from "react";

function Korisnici() {
    const [listOfKorisnici, setListOfKorisnici] = useState([]);

    useEffect(() => {
      axios.get("http://localhost:3100/korisnik").then((response) => {
        setListOfKorisnici(response.data);
      });
    }, []);


  return (
    <table>
    <thead>
          <tr>
            <th>ID</th>
            <th>Ime</th>
            <th>Prezime</th>
            <th>Adresa</th>
            <th>Grad</th>
            <th>Uloga</th>
          </tr>
      </thead>
      <tbody>
    {listOfKorisnici.map((value, key) => {
        return (
          <div className="korisnici">
            <tr >{value.korisnikID}</tr>
            <tr>{value.ime}</tr>
            <tr>{value.prezime}</tr>
            <tr>{value.adresa}</tr>
            <tr>{value.nazivGrada}</tr>
            <tr>{value.uloga}</tr>
          </div>
        );
      })}
</tbody>
</table>
  )
}

export default Korisnici
